import React,  {Component} from "react";

export default class BookCard extends Component {
    constructor(props){
        super(props);
    }
    render() {
        return(
            <div className="card">
                <img src="{props.image}"/>
                <h4>{props.title}</h4>
            </div>
        );
    }
}
